import re
regex = r'^S\s+((?:(?:\d+\. )|(?:\.\d+\.\)))\s+([a-zA-Z]+)'
pattern = re.compile(regex)
def get_sum(a, b):
    return int(a + float(b))
def get_magic_number():
    return int('42')

if __name__ == '__main__':
    print(pattern.search('5 6'))
    print(pattern.findall('9.5 10.'))
